#include <iostream>
#include <algorithm>
#include <vector>
#include <math.h>

using namespace std;

long n, k, a, q, possiblePositions;

int howManyCanFit(int interval)
{
    int fitShips = interval / a;
    int dividers = fitShips - 1;
    int result = fitShips * a + dividers;

    while (interval < result)
    {
        --fitShips;
        --dividers;
        result = fitShips * a + dividers;
    }

    return fitShips;
}

bool predicate(int tries, vector<int> &shots)
{
    int totalShips = 0;
    vector<int> possibleFirstTries(shots.begin(), shots.begin() + tries);
    sort(possibleFirstTries.begin(), possibleFirstTries.end());

    int left = 0, right = possibleFirstTries.front();

    if (possibleFirstTries.size() == 1)
    {
        int leftSize = right - left;
        int rightSize = n - right - 1;

        int leftTotalShips = howManyCanFit(leftSize);
        int rightTotalShips = howManyCanFit(rightSize);
        totalShips += leftTotalShips + rightTotalShips;
    }

    for (int i = 0; i < possibleFirstTries.size() - 1; i++)
    {
        int intervalSize = right - left;

        totalShips += howManyCanFit(intervalSize);

        left = right + 1;
        right = possibleFirstTries[i + 1];

        if (i == possibleFirstTries.size() - 2)
        {
            int beforeLastInterval = right - left;
            totalShips += howManyCanFit(beforeLastInterval);
        }
    }

    if (possibleFirstTries.size() != 1)
    {
        int lastInterval = n - right - 1;
        totalShips += howManyCanFit(lastInterval);
    }

    if (k > totalShips)
        return true;

    return false;
}

int binarySearchIterative(int r, vector<int> &shots, bool(*pred)(int, vector<int>&))
{
    int res = -1, l = 1, mid;

    while (l < r)
    {
        mid = l + (r - l) / 2;
        if (pred(mid, shots))
        {
            r = mid;
            res = mid;
        }
        else
        {
            l = mid + 1;
        }
    }

    if (l == r)
    {
        if (pred(l, shots))
            res = l;
    }

    return res;
}

int main() {
    vector<int> shots;
    cin >> n >> k >> a;
    cin >> q;
    possiblePositions = 0;

    for (int i = 0; i < q; i++)
    {
        int qies = 0;
        cin >> qies;
        qies--;
        shots.push_back(qies);
    }

    cout << binarySearchIterative(q, shots, predicate) << endl;
}

